import {
  Vue
} from '@boot';
import VueRouter from 'vue-router';
import routes from '@router/router';
import {
  Lazyload
} from 'vant';
import Showcase from './showcase';

Vue.use(VueRouter).use(Lazyload, {
  lazyComponent: true
});

const router = new VueRouter({
  routes
});

new Vue({
  router,
  render: h => h(Showcase)
}).$mount('#app');
